 	'Gua': '\u518e\u53e7\u74dc\u5471\u8bd6\u5366\u522e\u576c\u5250\u80cd\u6302\u526e\u681d\u639b\u5569\u6870\u9e39\u7f63\u7d53\u6b44\u98aa\u7171\u8d8f\u8902\u8a7f\u7dfa\u5be1\u5280\u8e3b\u98b3\u9d30\u9a27',
 	'Guai': '\u592c\u53cf\u62d0\u602a\u4e56\u6060\u67fa\u67b4\u7f6b\u6451\u7b89',
 	'Guan': '\u535d\u6bcc\u4e31\u5173\u89c2\u4e32\u7eb6\u5b98\u8d2f\u6cf4\u51a0\u77dc\u898c\u500c\u839e\u8cab\u9986\u63bc\u6dab\u60ef\u60ba\u60b9\u68fa\u797c\u742f\u8484\u75ef\u7b66\u7aa4\u7ba1\u95a2\u645c\u6f45\u9066\u6163\u6a0c\u8f28\u761d\u8218\u9327\u9928\u74ad\u76e5\u96da\u7f46\u764f\u9ccf\u95d7\u8e80\u89b3\u93c6\u95dc\u704c\u74d8\u721f\u9c25\u9ce4\u9e73\u77d4\u7936\u7f50\u89c0\u9c5e\u9475\u9e1b\u6b1f\u9c79',
 	'Guang': '\ue822\u5e7f\u5e83\u5149\u72b7\u706e\u7097\u709a\u709b\u59ef\u4fc7\u832a\u6d38\u5799\u54a3\u901b\u70e1\u6844\u73d6\u80f1\u81e6\u8f04\u50d9\u5ee3\u92a7\u9ec6\u7377\u81e9',
 	'Gui': '\u5f52\u5b84\u6c3f\u572d\u8f68\u6530\u5e8b\u59ab\u9f9f\u523f\u523d\u5326\u90bd\u9652\u4f79\u8be1\u7085\u7094\u89c4\u67dc\u660b\u8d35\u579d\u6051\u8325\u59fd\u95fa\u6531\u7688\u7678\u8ecc\u9b3c\u5e30\u5eaa\u6842\u6867\u796a\u73ea\u80ff\u88bf\u532d\u4e80\u898f\u7845\u86eb\u7b40\u8cb4\u5ec6\u5aaf\u7324\u6677\u691d\u6922\u6e40\u7470\u8dea\u84d5\u89e4\u8a6d\u90cc\u95a8\u9c91\u7786\u53ac\u646b\u5ae2\u69fb\u69fc\u648c\u879d\u528c\u528a\u69f6\u5b00\u77a1\u6a3b\u749d\u9f9c\u79ac\u6a9c\u7c0b\u77b6\u9bad\u9b36\u7650\u87e1\u8958\u6b78\u6ac3\u5db2\u96df\u9a29\u9cdc\u9400\u6af7\u74cc\u9b39\u862c\u97bc\u944e\u9c56\u9c65',
 	'Gun': '\u4e28\u889e\u7ef2\u60c3\u8f8a\u68cd\u7754\u84d8\u6eda\u8509\u6efe\u7dc4\u78d9\u7df7\u8f25\u9ca7\u9b8c\u9bc0\u8b34',
 	'Guo': '\u8fc7\u5459\u56ef\u56fb\u679c\u56fd\u56f6\u5700\u54b6\u90ed\u6da1\u57da\u83d3\u904e\u5e3c\u556f\u7313\u5d1e\u9983\u581d\u63b4\u6dc9\u570b\u60c8\u8901\u8052\u921b\u6901\u6947\u8158\u8142\u9505\u7611\u588e\u852e\u8748\u873e\u805d\u69e8\u7cbf\u7db6\u88f9\u6fc4\u6f0d\u6156\u5613\u5e57\u5f49\u8f20\u8195\u8662\u934b\u991c\u9998\u7c02\u87c8\u5f4d\u61d6\u9439',
