 	'Hai': '\u4ea5\u8fd8\u598e\u548d\u54b3\u9a87\u5b69\u6c26\u80f2\u5bb3\u6d77\u70f8\u55e8\u55d0\u9900\u5870\u917c\u9ab8\u99ed\u99f4\u91a2\u995a',
 	'Han': '\ue838\u516f\u9097\u6c49\u5388\u6c57\u625e\u95ec\u5c7d\u72b4\u90af\u7f55\u4f44\u542b\u65f1\u51fd\u9878\u51fe\u8677\u608d\u6d6b\u6d86\u57be\u5705\u5505\u54fb\u839f\u7302\u5a22\u634d\u6d5b\u5d21\u83e1\u6db5\u7113\u710a\u6657\u6892\u86b6\u6658\u7400\u91ec\u9588\u9807\u9163\u97e9\u7694\u7745\u558a\u5bd2\u5d45\u50bc\u751d\u86ff\u7b68\u99af\u9894\u611f\u872d\u6f22\u850a\u6496\u5ae8\u8c3d\u7233\u872c\u6f8f\u71af\u61a8\u66b5\u92b2\u92ce\u92e1\u9b7d\u9837\u99a0\u7ff0\u8792\u61be\u64bc\u97d3\u9f3e\u9844\u99fb\ue821\u96d7\u8c43\u8b40\u701a\u9dbe\ue820',
 	'Hang': '\u592f\u884c\u6c86\u542d\u82c0\u8fd2\u80ae\u65bb\u7095\u676d\u7ed7\u5df7\u57b3\u822a\u7b10\u73e9\u86a2\u6841\u8ca5\u88c4\u7b55\u7d4e\u980f\u9b67',
 	'Hao': '\u4e5a\u53f7\u597d\u660a\u79cf\u7ad3\u90dd\u4fb4\u8320\u6626\u768b\u54e0\u6d69\u608e\u869d\u8017\u604f\u6667\u6beb\u6dcf\u5090\u9117\u6903\u7693\u6ec8\u865f\u8055\u8c89\u84bf\u55e5\u7346\u7354\u5651\u8c6a\u66a4\u66ad\u769e\u769c\u5637\u734b\u6f94\u9550\u85a7\u8585\u8583\u512b\u76a1\u66cd\u5686\u76a5\u568e\u6fe0\u58d5\u98a2\u8814\u7c47\u8b79\u9865\u9c1d\u704f\u705d',
 	'He': '\u79be\u5408\u7ea5\u5413\u4f55\u8bc3\u52be\u548c\u548a\u59c0\u62b2\u6cb3\u4f6b\u90c3\u5475\u67c7\u76c7\u66f7\u7c7a\u7d07\u9978\u72e2\u5cc6\u9602\u578e\u8d3a\u5bb3\u54ec\u8377\u7259\u5408\u8894\u91db\u6546\u6b31\u76cd\u76c9\u6838\u83cf\u8402\u555d\u5bc9\u6db8\u7103\u6e2e\u76d2\u9f81\u9e44\u988c\u7cad\u8cc0\u8a38\u8a36\u60d2\u7332\u559d\u55ec\u55c3\u9616\u788b\u6f95\u8c89\u7142\u6941\u6bfc\u8a65\u8c88\u924c\u9c84\u9904\u95a1\u8d6b\u8910\u9ea7\u7187\u7186\u9e56\u9e64\u981c\u9b7a\u879b\u7bd5\u7fee\u7fef\u8b1e\u764b\u58d1\u5687\u9932\u71fa\u7200\u7909\u95d4\u97a8\u9f55\u8988\u881a\u9da1\u9db4\u9dae\u9449\u76ac\u9fa2\u9e16\u974d\u974e\u974f',
 	'Hei': '\u9ed2\u9ed1\u55e8\u563f\u6f76',
